"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["7953"],{4534:function(e){e.exports=JSON.parse('{"name":"TODO-Checker","slug":"todo-checker","url":"https://codeberg.org/Epsilon_02/todo-checker","description":"Plugin to check if TODOs has an open issue number to the project repository (currently only forgejo supported)","docs":"<h2>Settings</h2>\\n<table>\\n<thead>\\n<tr>\\n<th>Settings Name</th>\\n<th>Default</th>\\n<th>Description</th>\\n</tr>\\n</thead>\\n<tbody><tr>\\n<td><code>prefix_regex</code></td>\\n<td><code>(TODO|FIXME)</code></td>\\n<td>prefix which should a comment start to check if there should exist a issue number</td>\\n</tr>\\n<tr>\\n<td><code>main_regex</code></td>\\n<td><code>( |)\\\\(#?(?P&lt;ISSUE_NUMBER&gt;\\\\d+)\\\\)</code></td>\\n<td>main regex to check how the issue number should be defined. IMPORTANT: if you want to build a custom regex, the name of the capturing group \\"ISSUE_NUMBER\\" have to be defined which only returns the issue-number!</td>\\n</tr>\\n<tr>\\n<td><code>page_size</code></td>\\n<td><code>default</code></td>\\n<td>page size which is provided by the forge (<code>default</code> and <code>max</code> are available with forgejo)</td>\\n</tr>\\n<tr>\\n<td><code>working_directory</code></td>\\n<td><code>.</code></td>\\n<td>the working directory where the checker should run. (only ignore in this specific directory are recognized)</td>\\n</tr>\\n<tr>\\n<td><code>repository_token</code></td>\\n<td>``</td>\\n<td>token if the repository to be checked is private</td>\\n</tr>\\n<tr>\\n<td><code>debug</code></td>\\n<td><code>false</code></td>\\n<td>enable debug output</td>\\n</tr>\\n</tbody></table>\\n<h3>Building custom regex</h3>\\n<p>This plugin is build in rust, so it uses the <a href=\\"\\">regex crate</a> under the hood. If you want to build your own regex use the <a href=\\"https://docs.rs/regex/latest/regex/#syntax\\">rust regex syntax</a>.</p>\\n<h3>Versions</h3>\\n<h4>1.x.x</h4>\\n<p>Version 1.x.x was written in shell (with <a href=\\"https://github.com/BurntSushi/ripgrep\\">ripgrep</a> under the hood) and works with the following ignore files: <code>.rgignore</code>, <code>.ignore</code>, <code>.gitignore</code>.\\nIt treats <code>.rgignore</code>-files with higher precedence than <code>.ignore</code>-files and <code>.ignore</code>-files with a higher precedence than <code>.gitignore</code>.\\nCheck also the <a href=\\"https://github.com/BurntSushi/ripgrep/blob/master/GUIDE.md#automatic-filtering\\">ripgrep manual</a> out for further reading.</p>\\n<h4>2.x.x</h4>\\n<p>Since version 2.x.x. The plugin got a complete rust rewrite and made compatible with the latest forgejo API.\\nIgnore files which are supported are the following: <code>.ignore</code> and <code>.gitignore</code>.</p>\\n","tags":["todo","testing"],"author":"Epsilon_02","containerImage":"codeberg.org/epsilon_02/todo-checker","containerImageUrl":"https://codeberg.org/Epsilon_02/-/packages/container/todo-checker/latest","verified":false}')}}]);